import { Route, Routes as ReactRouterRoutes, Navigate } from 'react-router-dom';
import PrivateRoute from '../components/Route/PrivateRoute';
import ArticleDetail from './Article/ArticleDetail';
import ArticleModify from './Article/ArticleModify';
import ArticleRegist from './Article/ArticleRegist';
import ChatList from './Chat/ChatList';
import ChatRoom from './Chat/ChatRoom';
import DummyPage from './DummyPage/DummyPage';
import Index from './Index/Index';
import Redirect from './Index/Redirect';
import Join from './Join/Join';

import Like from './Like/Like';
import Main from './Main/Main';
import ProfileInfoModify from './Profile/ProfileInfoModify';
import ProfileTownModify from './Profile/ProfileTownModify';
import ProfileUser from './Profile/ProfileUser';

const Article = () => {
	return (
		<ReactRouterRoutes>
			{/* 글 상세 */}
			<PrivateRoute path=":articleId" element={<ArticleDetail />} />
			{/* 글 등록 */}
			<PrivateRoute path="regist" element={<ArticleRegist />} />
			{/* 글 수정 */}
			<PrivateRoute path="modify/:articleId" element={<ArticleModify />} />
			<Route path="*" element={<Navigate replace to="/" />} />
		</ReactRouterRoutes>
	);
};

const Chat = () => {
	return (
		<ReactRouterRoutes>
			{/* 채팅리스트 */}
			<PrivateRoute path="list" element={<ChatList />} />
			{/* 채팅상세 */}
			<PrivateRoute path="room" element={<ChatRoom />} />
			<Route path="*" element={<Navigate replace to="list" />} />
		</ReactRouterRoutes>
	);
};

const Profile = () => {
	return (
		<ReactRouterRoutes>
			{/* 프로필 */}
			<PrivateRoute path=":userId" element={<ProfileUser />} />
			{/* 내정보수정 */}
			<PrivateRoute path="modify/info/:userId" element={<ProfileInfoModify />} />
			{/* 내동네수정 */}
			<PrivateRoute path="modify/town/:userId" element={<ProfileTownModify />} />
			<Route path="*" element={<Navigate replace to="/" />} />
		</ReactRouterRoutes>
	);
};

export const Routes = () => {
	return (
		<ReactRouterRoutes>
			{/* 테스트용 더미 페이지 */}
			<Route exact path="dummy" element={<DummyPage />} />

			{/* 초기화면  */}
			<Route path="/" element={<Index />} />
			{/* 소셜 로그인 리다이렉트  */}
			<Route path="/oauth/redirect" element={<Redirect />} />

			{/* 회원가입 페이지 */}
			<Route path="join/*" element={<Join />} />

			{/* 메인페이지 */}
			<PrivateRoute path="main" element={<Main />} />
			{/* 찜피드 */}
			<PrivateRoute path="like" element={<Like />} />

			{/* 글  */}
			<PrivateRoute path="article/*" element={<Article />} />

			{/* 채팅 */}
			<PrivateRoute path="chat/*" element={<Chat />} />

			{/* 프로필 */}
			<PrivateRoute path="profile/*" element={<Profile />} />

			<Route path="*" element={<Navigate replace to="dummy" />} />
		</ReactRouterRoutes>
	);
};
